import AppDetails from "./config";
import "./assets/css/App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={AppDetails.logo} className="App-logo" alt="logo" />
        <p>{AppDetails.formatedTitle} - Your Laptop Is Here !</p>
      </header>
    </div>
  );
}

export default App;
